import React, { useState, useEffect } from 'react';
//import { useNavigation } from 'react-router-dom';
import './List.css'

const CarList = () => {
  const [cars, setCars] = useState([]);
 
  useEffect(() => {
    const fetchCars = async () => {
      const response = await fetch('https://localhost:7079/api/Car');
      const result = await response.json();
      setCars(result);
    };
    fetchCars();
  }, []);

  const handleAddCar = async (car) => {
    const response = await fetch('https://localhost:7079/api/Car', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(car),
    });
    const result = await response.json();
    setCars([...cars, result]);
  };

  const handleDeleteCar = async (id) => {
    await fetch(`https://localhost:7079/api/Car/${id}`, {
      method: 'DELETE',
    });
    setCars(cars.filter((car) => car.Car_id !== id));
  };

  return (
    <div >
      {cars.map((car) => (
        <div key={car.Car_id}>
          <h3>{car.Make} {car.Model}</h3>
          <p>Cost: ${car.Cost}</p>
          <p>Capacity: {car.Capacity}</p>
          <p>Status: {car.Status}</p>
          <img src={car.ImagePath} alt={`${car.Make} ${car.Model}`} />
          <button onClick={() => handleDeleteCar(car.Car_id)}>Delete</button>
        </div>
      ))}
      <button onClick={handleAddCar}>Add Car</button>
    </div>
  );
};

export default CarList;
